import React from 'react';
import Fade from 'react-reveal/Fade';

class FadeExample extends React.Component {
  render() {
    return (
      <div>
        <Fade right big>
          <h1>React Reveal</h1>
        </Fade>
      </div>
    );
  }
}

export default FadeExample;
